#include<cctype>
#include<cstdio>
using namespace std;
inline int readint(){
    int x=0;
    bool f=0;
    char c=getchar();
    while(!isdigit(c)&&c!='-') c=getchar();
    if(c=='-'){
        f=1;
        c=getchar();
    }
	while(isdigit(c)){
        x=x*10+c-'0';
        c=getchar();
    }
    return f?-x:x;
}
const int maxn=1e6+5;
int n,m,k,cnt[maxn];
typedef long long ll;
ll mod=1e9+7;
ll inv[maxn],c[maxn];
int minf[maxn];
ll mu[maxn];
ll g[maxn];
int main(){
    #ifdef LOCAL
    freopen("in.txt","r",stdin);
    freopen("out.txt","w",stdout);
    #endif
    n=readint();
    m=readint();
    k=readint();
    for(int i=0;i<n;i++) cnt[readint()]++;
    inv[1]=1;
    for(int i=2;i<=n-k;i++) inv[i]=inv[mod%i]*(mod-mod/i)%mod;
    c[k]=1;
    for(int i=k+1;i<=n;i++) c[i]=c[i-1]*i%mod*inv[i-k]%mod;
    for(int i=2;i<=m;i++) if(!minf[i])
    	for(int j=i;1ll*i*j<=m;j++) minf[i*j]=i;
    mu[1]=1;
    for(int i=2;i<=m;i++)
    	if(!minf[i]) mu[i]=mod-1;
    	else{
    		if((i/minf[i])%minf[i]==0) mu[i]=0;
    		else mu[i]=mu[minf[i]]*mu[i/minf[i]]%mod;
		}
	for(int i=1;i<=m;i++){
		int tot=0;
		for(int j=1;i*j<=m;j++) tot+=cnt[i*j];
		g[i]=c[tot];
	}
	for(int i=1;i<=m;i++){
		ll ans=0;
		for(int j=1;i*j<=m;j++) ans=(ans+mu[j]*g[i*j]%mod)%mod;
		printf("%d ",(int)ans);
	}
	printf("\n");
    return 0;
}
